$templateCache.put("templates/main.html","<ion-view view-title=Bilverksted><ion-content><div class=card><div class=\"item item-divider item-text-wrap\">Om bilverksted appen</div><div class=\"item item-text-wrap\"><b>Reparasjoner på kjøretøy kan som hovedregel bare utføres av verksteder som er godkjent av Statens vegvesen. Hensikten med godkjenningsordningen er å sikre at reparasjoner blir utført på en profesjonell og trafikksikker måte.</b><p>Bilverksted appen kan brukes for å finne et godkjent bilverksted og/eller et godkjent kontrollorgan som utfører EU-kontroll. Reparasjoner på kjøretøy og EU-kontroll kan som hovedregel bare utføres av godkjente verksteder og kontrollorgan.</p></div></div><div class=card><div class=\"item item-divider item-text-wrap\">Om godkjenningsordningen</div><div class=\"item item-text-wrap\">De som skal reparere vitale deler på bil, motorsykkel, moped, traktor og motorredskap konstruert for hastighet større enn 50 km/t eller tilhenger med brems må ha egen godkjenning. Vitale deler er for eksempel bremser, styreinnretning, hjulutrustning og elektrisk anlegg.</div></div><div class=card><div class=\"item item-divider item-text-wrap\">Hvordan kan jeg vite at verkstedet er godkjent?</div><div class=\"item item-text-wrap\">I Bilverksted appen finner du oversikt over godkjente verksteder.Verksteder som driver lovlig reparasjonsarbeid har i tillegg eget utvendig skilt som viser at det er godkjent av Statens vegvesen.</div></div><div class=card><div class=\"item item-divider\">Lisens</div><div class=\"item item-text-wrap\">Inneholder data under norsk lisens for offentlige data (NLOD) tilgjengeliggjort av <a href=http://www.vegvesen.no/ >Vegvesen</a></div></div></ion-content></ion-view>");
